INSERT INTO `itemrtdb_concept` VALUES (1,'冠词','冠词（Article）是一种虚词，在句子中不重读，本身不能独立使用，只能放在名词前帮助说明名词所指的人或事物，它是英语词性中最小的一类，只有三个，一种是不定冠词（Indefinite Article），一种是定冠词（Definite Article）。此外也有些特定场合不用冠词，即通常所称的零冠词（Zero Article）。',1),(2,'不定冠词-a,an','不定冠词，英语虚词冠词的一种，冠词是虚词，本身不能单独使用，也没有词义，它用在名词的前面，帮助指明名词的含义。英语中的冠词有三种，一种是定冠词（the Definite Article），另一种是不定冠词（the Indefinite Article），还有一种是零冠词（Zero Article）。不定冠词a (an)与数词one 同源，是\"一个\"的意思。a用于辅音音素前，一般读作e，而an则用于元音音素前，一般读做an。',1),(3,'定冠词-the','定冠词是虚词，用在名词的前面，帮助指明名词的含义。区别于不定冠词，定冠词具有确定的意思，用以特指人或事物，表示名词所指的人或事物是同类中的特定的一个，以别于同类中其他的人或事物，相当于汉语中的“那个”或“这个”的意思。它可以和单、复数名词，也可以和不可数的名词连用。\n',1),(4,'零冠词','冠词本身不能单独使用，也没有词义，它用在名词的前面，帮助指明名词的含义。英语中的冠词有三种，一种是定冠词，另一种是不定冠词，还有一种是零冠词。零冠词(Zero articles )即是指名词前面没有不定冠词( a、an )、定冠词( the )，也没有其他限定词的现象。\n',1),(5,'量词','通常用来表示人、事物或动作的数量单位的词，叫做量词(quantifier)。',5),(6,'名词','名词（Noun,简称n.），是词类的一种，属于实词，名词表示人、事物、地点或抽象概念的名称，名词同时也分为专有名词和普通名词。',12),(7,'专有名词','专有名词(Proper Noun)表示具体的人，事物，地点，团体或机构的专有名称(第一个字母要大写)。 例：China(中国)、Asia(亚洲)、Beijing(北京)、the People’s Republic Of China(中华人民共和国)。\n专有名词如果是含有名词短语，则必须使用定冠词the。如：the Great Wall(长城)。\n姓氏名如果采用复数的形式，则表示该姓氏一家人(复数含义)。如：the Greens(格林一家人)。',12),(8,'普通名词','表示某些人，某类事物，某种物质或抽象概念的名称。例如：teacher老师、tea茶、reform改革。\n普通名词又可进一步分为五类：\n(1)个体名词(Individual Nouns)：表示单个的人和事物。如car(汽车)、room(房间)、 fan(风扇)、photo(照片)\n(2)集体名词(Collective Nouns)：表示一群人或一些事物的名称。如 people(人们)、family(家庭)、army(军队)、government(政府)、group(集团)\n(3)复合名词(Compound Nouns)：两个或两个以上名词连在一起构成的名词。如passerby(过路人)、brother-in-law(内兄)\n(4)物质名词(Material Nouns)：表示物质或不具备确定形状和大小的个体的物质。如 fire(火)、steel(钢)、air (空气)、water(水)、milk(牛奶)\n(5)抽象名词(Abstract Nouns)：表示动作，状态，品质或其他抽象概念。如 labor( 劳动)、health(健康)、life (生活)、friendship(友情)、patience(耐力)',12),(9,'可数名词','可数名词(Countable Nouns)是指能以数目来计算，可以分成个体的人或东西，因此它有复数形式。如cup(杯子)，cat(猫)等。',12),(10,'不可数名词','不可数名词(Uncountable Nouns)是指不能以数目来计算，不可以分成个体的概念、状态、品质、感情或表示物质材料的东西；它一般没有复数形式，只有单数形式，它的前面不能用不定冠词a / an。抽象名词，物质名词和专有名词一般是不可数名词。如 milk(牛奶),bread(面包),coffee(咖啡)等。',12),(11,'代词','代词(pronouns)是指代替名词、动词、形容词、数量词的词。',2),(12,'人称代词','英语中人称代词（Personal Pronoun）意为用于指代人的词汇，属于代词范畴，就像汉语中的“你”、“我”、“他”。常用的英语人称代词有：I、you、he、she、it（主格）。人称代词在句中作不同成分时有不同的形式，如：主格、宾格、第三人称单数形式等。\n',2),(13,'相互代词','相互代词(reciprocal pronoun)就是表示相互关系的代词。它与它所指代的名词或代词是一种互指关系，因此它们是复数或者二者以上。英语中的相互代词只有两个，即each other和one another。在正式文体中多用each other指两者，用one another 指两者以上。我们应当把它们当作复合代词看待，即使在分开使用时，它们也是相互关联的。',2),(14,'物主代词','表示所有关系的代词叫做物主代词(Possessive Pronouns)，也叫人称代词的所有格。物主代词分为形容词性物主代词和名词性物主代词两种。物主代词有人称和数的变化。第三人称单数的物主代词还有性别的变化。\n形容词性物主代词：\n单数形式：my（我的），your（你的），his /her/its（他的、她的、它的）。\n复数形式：our（我们的），your（你们的），their（他们的）。\n形容词性物主代词具有形容词的特性，常放在名词前面作定语，表明该名词所表示的人或物是\\\"谁的\\\"或xx belongs to sb。\n名词性物主代词：\n单数形式：mine（我的xx），yours（你的xx），his /hers /its（他的xx、她的xx、它的xx）。\n复数形式：ours（我们的xx），yours（你们的xx）， theirs（他们的xx）。',2),(15,'反身代词','反身代词（reflexive-pronouns）是一种表示反射或强调的代词。它的基本含义是：通过反身代词指代主语，使施动者把动作在形式上反射到施动者自己。因此，反身代词与它所指代的名词或代词形成互指关系，在人称、性质、数上保持一致。比如：我自己、你自己、他自己、我们自己等等。这就是反身代词。\n表示反射或强调的代词叫做反身代词。反身代词是由第一人称、第二人称形容词性物主代词或第三人称人称代词宾格形式，词尾加self或selves组成。反身代词可译为“本人”、“本身”，为加强语气，也常译为“亲自”、“自己”。',2),(16,'指示代词','\n指示代词（demonstrative pronoun）是表示指示概念的代词，即用来指示或标识人或事物的代词。指示代词与定冠词和人称代词一样，都具有指定的含义，用来起指示作用，或用来代替前面已提到过的名词。\n',2),(17,'疑问代词','1） 疑问代词（interrogative-pronoun）在句中起名词词组的作用，用来构成疑问句。疑问代词有下列几个：\nwhat, who, whose, whom, which, whatever, whichever ,whoever, whomever\n2） 疑问代词在句中应位于谓语动词之前，没有性和数的变化，除who之外也没有宾格的变化。what, which, whose还可作限定词。',2),(18,'关系代词','关系代词（relative-pronouns）用来引导定语从句。它代表先行词，同时在从句中作一定的句子成分。关系代词有主格，宾格和属格之分，并有指人与指物之分。\n限定性指人：主格（who, that），宾格(whom),属格(whose)\n非限定性指物：主格（which），宾格(which),属格(of which/whose)\n限定性指物：主格（that/which），宾格(that/which),属格(of which/whose)\n当先行词指人时，若它在从句中作主语，则用who；若它在从句作宾语，则用whom或who；若它在从句中作定语，则用whose。如：\nThe man who told me this refused to tell me his name. 告诉我这事的人不肯告诉我他的名字。\nThe woman whose umbrella you took is very angry about it. 你拿了那个女人的伞，她非常生气。\n当先行词指物时，若在定语从句中作主语或宾语，则用which；若它在定语从句中作定语用，则用of which或whose。如：\nI saw something in the paper which might interest you. 我在报上看到一样可能使你感兴趣的东西。\nHe’s written a book the name of which (whose name) I’ve forgotten. 他写了一本书，书名我给忘了。',2),(19,'相互代词','相互代词(reciprocal pronoun)就是表示相互关系的代词。它与它所指代的名词或代词是一种互指关系，因此它们是复数或者二者以上。英语中的相互代词只有两个，即each other和one another。在正式文体中多用each other指两者，用one another 指两者以上。我们应当把它们当作复合代词看待，即使在分开使用时，它们也是相互关联的。',2),(20,'不定代词','不定代词（indefinite-pronoun），即不指明代替任何特定名词或形容词的代词。不定代词,简单说：不指明代替任何特定名词或形容词的代词；　\n不定代词大都可以代替名词和形容词,在句中作主语、宾语、表语和定语.\n常用不定代词有：\nsome（something，somebody，someone），any（anything，anybody，anyone）， no（nothing，nobody，no one）， every（everything，everybody，everyone），all，each，both，much，many，（a）little，（a）few，other（s），another，none，one，either， neither等。\n由body，one，thing构成的合成代词：\nsomebody，anybody，everybody，nobody\nsomeone，anyone，everyone，no one\nsomething，anything，everything，nothing',2),(21,'形容词','形容词（Adjective）是说明人或事物的属性、状态或特征的词，在句子中主要作名词的装饰语。形容词通常置于其修饰的名词之前，并且多数形容词具有比较等级。\n',5),(22,'描述形容词','表示名词的性质、颜色、大小和状态等的形容词。如：\nHe bought some new books. 他买了一些新书。\nThese books are new. 这些书是新的。\nShe wrote the letter with blue ink. 她用蓝墨水写了那封信。\nThe ink is blue. 这些墨水是蓝色的。',5),(23,'物质形容词','由物质名词充当或物质名词转换而成的形容词。如：\nThis glass dish looks very fragile. 这个玻璃盘子看起来很容易碎。\nIt\'s a glassy substance. 这是一种像玻璃一样光滑的物质。',5),(24,'数量形容词','1）不定数量形容词：不定代词之后接名词时即成为不定数量形容词。如：、\nWe got there without any trouble. 我们顺利到达那里。\nWe\'ll see some friends tomorrow. 我们明天将去看一些朋友\n2）数词。如：\nA square has four corners. 正方形有4个角。\nPlease accent the first syllable. 请重读第一个音节。\n3）倍数词。如：\nThe river is half a mile across. 江面宽半英里。\nThey bought a double bed. 他们买了一张双人床。',5),(25,'专有形容词','由专有名词转换而成的形容词如地名、国名等。如：\nHe is a Chinese ambassador. 他是中国的大使。\nHe was born in Shanghai. 他出生于上海。',5),(26,'副词','副词（Adverb）是指在句子中表示行为或状态特征的词，用以修饰动词、形容词、其他副词或全句，表示时间、地点、程度、方式等概念。副词可分为：时间副词、频率副词、地点副词、方式副词、程度副词、疑问副词、连接副词、关系副词、表顺序的副词。\n副词连用顺序：程度副词+地点副词+方式副词+时间副词。\n功能： 起修饰或限制动词或形容词作用、表程度或范围的词。',6),(27,'时间频率副词','now,then,often,always,usually,next,lastday,already(已经),generally(一般地),frequently（频繁）,seldom（很少地）,ever,never,yet,soon,too, immediately（立即）, finally,shortly（很快）, before, ago,sometimes, yesterday. once，twice，lately，recently,personally,today……',6),(28,'地点副词','here, there, everywhere, anywhere,somewhere, in, out, inside, outside, above, below, up,down, back, forward（向前地）, home, upstairs(楼上地), downstairs, across, along, round , around, near, off, past, up, away, on.……',6),(29,'方式副词','carefully, properly(适当地), anxiously(焦虑地), suddenly, normally(正常地), fast, well, calmly(冷静地), politely(有礼貌地), proudly(自豪地), softly, warmly ,slowly,badly,hard,bravely……',6),(30,'程度副词','much,little, very,rather(相当),so,too,still, quite, perfectly(完美地), enough, extremely(非常), entirely(整个),almost, slightly(细小地), hardly.……',6),(31,'疑问副词','how, when, where, why……',6),(32,'关系副词','when, where, why……',6),(33,'连接副词','therefore(因此),moreover(此外),however,otherwise(另外的),then,when ,where,how,why……',6),(34,'表顺序的副词','first,then,next,finally,afterwards,primarily……',6),(35,'完成时的副词','already,ever,just,never,since,yet,recently……\n',6),(37,'介词','介词（preposition 简写prep.）又称作前置词，表示名词、代词等与句中其他词的关系，在句中不能单独作句子成分。介词后面一般有名词、代词或相当于名词的其他词类、短语或从句作它的宾语，表示与其他成分的关系。介词和它的宾语构成介词词组，在句中作状语，表语，补语，定语或介词宾语。介词可以分为时间介词、地点介词、方式介词、原因介词、数量介词和其他介词。\n介词一般用于名词或者代词前面，表示该词与句中其他成分的关系。介词后面的名词或代词称为介词宾语（如果是人称代词，则要用宾格）。介词和介词宾语合在一起构成介词短语。',8),(38,'时间介词','表示时间的介词叫做时间介词。\n1、表示在某时间.常用介词at,on,in等。\n2、表示期间常用介词during,for,over,within,throughout,from和to等。\n3、表示其他时间概念的介词有before,after,since,until,till,between,up to等',8),(39,'方位介词','1.at ,in, on, to，for\nat (1)表示在小地方; (2)表示“在„„附近，旁边”\nin (1)表示 在大地方; (2)表示“在„范围之内”。\non 表示毗邻，接壤，“在„„上面”。\nto 表示在„„范围外，不强调是否接壤；或“到„„”\n2.above, over, on 在„„上\nabove 指在„„上方,不强调是否垂直，与 below相对；\nover指垂直的上方,与under相对,但over与物体有一定的空间，不直接接触。\non表示某物体上面并与之接触。\nThe bird is flying above my head. There is a bridge over the river. He put his watch on the desk. 3.below, under 在„„下面 under表示在„正下方 below表示在„„下，不一定在正下方\nThere is a cat under the table. Please write your name below the line.\n4.in front [frant]of, in the front of在„„前面 in front of…意思是“在„„前面”，指甲物在乙物之前，两者互不包括；其反义词是behind（在„„的后面）。 There are some flowers in front of the house.(房子前面有些花卉。) in the front of 意思是“在„..的前部”，即甲物在乙物的前部.反义词是at the back of…（在„„范围内的后部）。 There is a blackboard in the front of our classroom. 我们的教室前边有一块黑板。\nOur teacher stands in the front of the classroom. 我们的老师站在教室前.(老师在教室里)\n5.beside，behind beside 表示在...旁边 behind 表示在...后面。',8),(40,'表进行的介词','作为表语时，英语介词可以表示正在“进行”的动作。他举例说明：\nHe is at work. (他正在工作。)\nThe house is on fire! (房子着火了!)\nThe road isunderconstruction. (路正在修。)',8),(41,'表原因的介词','表示原因常用的介词有for 等。',8),(42,'表方法的介词','表示“方法 ，手段”的介词常用by,with,through等\nby bike ： 骑自行车',8),(43,'表数量的介词','表示数量的常用介词有about(around),over等',8),(44,'介词短语','above构成的惯用短语：\nabove all 尤其是，最重要的是 above suspicion 无可怀疑 above praise 赞美不尽 above criticism 无可指责\nabove reproach 无可厚非 above price 价值连城\nafter构成的惯用短语\nafter all 毕竟，到底 day after day 日复一日 one after another 接二连三 page after page一页又一页地\nyear after year 年年岁岁 wave after wave一波又一波地 bus after bus 公共汽车一辆又一辆\nat构成的惯用短语\natthesightof看到 atthenewsof听到 at one’s ease/ at one’s leisure 在闲暇时',8),(45,'动词','动词（Verb），就是用来表示动作或状态的词汇。基本上每个完整的句子都有一个动词，要表示第二个动作时可使用不定词、动名词、对等连接词、从属连接词或增加子句等方法连结。\n1） 四类句中功能\n分别是：实义动词（Notional Verb）、系动词（Link Verb）、助动词（Auxiliary Verb）、情态动词（Modal Verb）。\n2）两类其后是否带有宾语\n分别是：及物动词（Transitive Verb）、不及物动词（Intransitive Verb）\n3） 根据是否受主语的人称和数的限制\n分别是：限定动词（Finite Verb）、非限定动词（Non-finite Verb）\n\n',4),(46,'时态','时态是英语谓语动词的一种形式，表示动作发生的时间和所处的状态.英语中的时态是通过动词形式本身的变化来实现的.英语有16种时态，但较常用的有十种：一般现在时,一般过去时,一般将来时,过去将来时,现在进行时，过去进行时，将来进行时,过去完成时，现 在完成时和现 在完成进行时.',4),(47,'一般现在时','一般现在时(Simple present tense)。表示通常性、规律性、习惯性、真理性的状态或者动作（有时间规律发生的事件）的一种时间状态。\n基本用法\n1、 表示经常性或习惯性的动作或存在的状态\n2、 表示客观事实或普遍真理\n3、 在时间、条件等状语从句中，用一般现在时表示将来\n4、 在某些以here，there开头的句子中，用一般现在时表示正在发生的动作',4),(48,'现在进行时','现在进行时表示正在进行的动作或存在的状态。现在进行时表示动作发生的时间是“现在”，动作目前的状态是“正在进行中”。\n现在进行时表示正在进行的动作或存在的状态。\n现在进行时的构成是：主语+be动词（am /is /are）+动词ing形式〔现在分词〕\n肯定句：主语+be动词（am /is /are）+动词ing+其他。\n否定句：主语+be动词（am /is /are）+not+动词ing+其他。\n一般疑问句：Be动词+主语+动词ing+其他。\n回答：Yes，主语+be. 或 No，主语+be not.\n特殊疑问句：特殊疑问词+一般疑问句\n肯定回答：Yes，主语+be动词（am /is /are）。\n否定回答：No，主语+be动词（am /is /are）+not。',4),(49,'现在完成时','现在完成时表示过去发生的动作对现在造成的影响或结果或表示过去的动作或状态持续到现在。它的构成是：主语+have/has +动词的过去分词。\n句型构成\n基本结构：主语+have/has+动词的过去分词（p.p）\n现在完成时用法：\n①肯定句：主语+have/has+动词的过去分词(p.p)（V-ed）+宾语（或者其他）.\n②否定句：主语+have not/has not+动词的过去分词（p.p）（V-ed）+宾语.\n③一般疑问句：Have/Has+主语+动词的过去分词（p.p)（V-ed）+宾语（或者其他）?\n④特殊疑问句：特殊疑问词+一般疑问句（have/has+主语+过去分词+其他）',4),(50,'现在完成进行时','现在完成进行时，是英语中，动词的一种基本时态，其构成为：主语+助动词（have/has）+been+动词的现在分词+其他成分。表示动作从某一时间开始，一直持续到现在，或者刚刚终止，或者可能仍然要继续下去。（与since，for连用时，要用连续性动词，不可用瞬间动词，但连续性动词常常表示动作会进行下去）\n也可以表示某种经历。\n但注意，现在完成进行时所应用的语境必须是现在（now等状语的提示或者根据上下文、语境）的，不能应用在过去的语境（如出现明确表示是在过去某一个时刻的状语）。',4),(51,'一般过去时','一般过去时表示过去某个时间里发生的动作或状态；过去习惯性、经常性的动作、行为；过去主语所具备的能力和性格。基本结构：主语+谓语(动词过去式）+句子其他成分；主语+was/were+形容词/名词/介词短语+过去时间；否定形式①was/were+not;②在行为动词前加didn\'t，同时还原行为动词；一般疑问句Did+主语+do+其他。\n一般过去时，表示过去某个时间里发生的非持续性动作或存在的状态，也表示经常或反复发生的动作。用动词的过去式表示，常和表示过去的时间状语连用，例如：yesterday，last night，in+过去的年份，two days ago，before，the age of，the day before yesterday等。\n一般过去时也表示过去经常或反复发生的动作，常和often，always等表示频率的时间状语连用。表示过去习惯性、经常性的动作、行为；过去主语所具备的能力和性格。\n肯定形式\n主语+动词过去式+其他\n例句：She often came to help us in those days.\n否定形式\n主语+didn\'t +谓语动词原型+其他\n①was/were+not；②在行为动词前加didn\'t，同时还原行为动词\n例句：I didn\'t know you like coffee.\n一般疑问句\n①Did+主语+谓语动词原型+其他？ ②Was/Were+主语+表语?\n例句：Did I do homework?',4),(52,'过去进行时','过去进行时（Past continuous tence或Past Progressive tence）表示过去在某一时间段或某一段时间内正在发生或进行的动作或状态。\n结构组成：\n1. 过去进行时由“主语+was/were + doing”构成\nEX： We were having supper when the phone rang. 我们正在吃晚饭时电话响了。\n2. 过去进行时的否定式由“主语+was/were not +doing”构成\nEX： This time yesterday Jack was not watching TV. He was repairing his bike. 昨天这个时候，杰克不是在看电视，而是在修理自行车。\n3. 过去进行时的疑问式由“was/were +主语+doing”组成\nEX： Were you playing basketball at four yesterday afternoon? 昨天下午四点你们在打篮球吗？',4),(53,'过去完成时','过去完成时(The Past Perfect Tense)：表示过去某一时间或动作以前已经发生或完成了的动作对过去的某一点造成的某种影响或是结果，用来指在另一个过去行动之前就已经完成了的事件。它表示动作发生的时间是“过去的过去”，侧重事情的结果。\n结构：\n主语+had+动词过去分词(done)\n①肯定句：主语+had+动词过去分词+其他.\n②否定句：主语+had+not+动词过去分词+其他.\n③一般疑问句：Had+主语+动词过去分词+其他+?\n肯定回答：Yes,主语+had.\n否定回答：No,主语+hadn\'t.(had not)\n④特殊疑问句：特殊疑问词或词组+一般疑问句（had+主语+过去分词+其他）\n⑤被动语态：主语+had(not) +been+动词过去分词+其他',4),(54,'过去完成进行时','相对过去的某个时刻来说已经对现在有直接影响并且还在进行的动作。放在间接引语或虚拟语气中时它的时态不能再向前推，向后推是现在完成进行时。\n基本结构：had+been +动词-ing',4),(55,'一般将来时','一般将来时表示将来某一时刻的动作或状态，或将来某一段时间内经常的动作或状态。常常和表示将来的时间状语连用。如：tomorrow（明天）， next week（下周 ）；in the future（将来）等。 一般将来时由助动词shall（第一人称），will（第二、三人称） 动词原形构成。美式英语则不管什么人称，一律用will。或用主语+be动词 + going to 动词 .',4),(56,'将来进行时','将来进行时主要表示将来某一时间正在进行的动作，或表示要在将来某一时间开始，并继续下去的动作。一般用延续性动词表示。常用来表示礼貌的询问、请求或期待等。例句：This time next day they will be sitting in the cinema.\n将来进行时常用的时间状语有soon, this evening，on Sunday, by this time，tomorrow, in two days, tomorrow evening等等。它表示的是一种客观的制约约束，而不是主观意愿。\n将来进行时是由\"shall/will + be + 现在分词\"构成的\nPlease don\'t call me between 8:00 and 10:00 tomorrow. I\'ll be having my classes then.\n明天8点到10点之间请不要给我打电话，我那时正在上课。\nWill you be using your bicycle this evening?今晚你用自行车吗？',4),(57,'将来完成时','将来完成时是用在表示在将来某一时间以前已经完成或一直持续的动作。经常与before+将来时间或by+将来时间连用，也可与before或by the time短语引导的现在时的从句连用。\n状态已完成：表示某事持续到将来某一时为止一直有的状态。并在将来完成。\n动作完成：表示将来某一时或另一个将来的动作之前，已经完成的动作或已经对动作会产生一定的影响。\n构成： shall（第一人称）will（第二、三人称）+have+过去分词（done）。\nThey will have been married for 20 years by then. 到那时他们俩结婚就满20年了。\n',4),(58,'其他将来时','过去将来时： 过去将来时表示从过去的某一时间来看将来要发生的动作或呈现的状态。过去将来时常用于宾语从句和间接引语中。一般过去将来时的出发点是过去，即从过去某一时刻看以后要发生的动作或状态。过去将来时由would，was/were going to，was/were to，was/were about to等加动词原形构成，也可由was/were on the point of加动名词构成\n过去将来进行时：\n过去将来进行时表示就过去某一时间而言，将来某一时刻或某一段时间正在进行的动作。主要用于宾语从句 中，尤其多用于间接引语中。结构：1.过去将来进行时由主语+should(would)+be+现在分词 ； 2.否定：主语+should(would)+not+be+现在分词； 3.疑问：should(would)+主语+be+现在分词（+其他）\n过去将来完成进行时：\n表示动作从过去某一时间开始一直延续到对于过去来说的将来某一时间，动作是否继续下去，由上下文决定。过去将来完成进行时是由should/would have been + v-ing构成；否定形式should/would+not have been + v-ing；疑问形式是将should/would提前。',4),(59,'及物动词，非及物动词','按动词后可否直接跟宾语，可把动词分成及物动词（表示为vt）和不及物动词（表示为vi）。\n后面必须跟宾语意义才完整的实义动词，叫做及物动词，本身意义完整后面不须跟宾语的实义动词，叫做不及物动词。',4),(60,'情态动词','情态动词（Modal verbs）本身有一定的词义，表示语气的单词。但是不能独立作谓语，只能和动词原形一起构成谓语。情态动词用在行为动词前，表示说话人对这一动作或状态的看法或主观设想。 情态动词虽然数量不多，但用途广泛，主要有下列： can (could), may (might), must, need, ought to, dare (dared), shall (should), will (would) must not.\n情态动词无人称和数的变化，情态动词后面跟的动词须用原形，否定式构成是在情态动词后面加 \"not\"。个别情态动词有现在式和过去式两种形式，过去式用来表达更加客气，委婉的语气，时态性不强，可用于过去，现在或将来。情态动词属非及物动词，故没有被动语态。\nHe could be here soon.\n他很快就来。\nWe can\'t carry the heavy box.\n我们搬不动那箱子。\nI\'m sorry I can\'t help you.\n对不起，我帮不上你。\n基本助动词与情态助动词最主要的区别之一是：基本助动词本身没有词义，而情态助动词则有自己的词义，能表示说话人对有关动作或状态的看法，或表示主观设想：\nWhat have you been doing since? （构成完成进行体，本身无词义）\n你一直在干什么？\nI am afraid I must be going. （一定要）\n恐怕我必须走了\nYou may have read some account of the matter. （或许已经）\n你可能已经读过关于这件事的一些报道\n除此之外，情态助动词还有如下词法和句法特征：\n1） 除ought和used和have to以外，其他情态动词后面只能接不带to的不定式。如果我们把ought to和used to看做是固定词组的话，那么，所有情态动词无一例外地只能接不带to的不定式：\nWe used to grow beautiful roses.我们过去常常种这种漂亮的玫瑰花\nI asked if he would come and repair my television set.我问他是否来修我的电视机\n2） 情态助动词在限定动词词组总是位居第一：\nThey need not have been punished so severely.\n他们不需要如此严厉的惩罚\n3）情态助动词用于第三人称单数现在时的时候，没有词形变化，即其词尾无-s形式：\nShe dare not say what she thinks.\n她不敢说她是怎么想的\n4） 情态动词没有非限定形式，即没有不定式和分词形式，也没有相应的动名词：\nStill,she needn\'t have run away.\n不过，她不必跑了\n5）情态助动词的“时”的形式并不是时间区别的主要标志。在不少场合，情态助动词的现在时和过去时形式都可以表示现在、过去或将来时间：\nWould you mind very much if I ask you to do something?\n你会很介意如果我让你做什么？\nShe told him he ought not to have done it.\n她告诉他他不应该这样做\n6） 情态助动词之间是相互排斥的，即在一个限定动\n词词组中只能出现一个情态助动词，但有时却可以与have和be基本助动词连用：\nYou should have washed the wound.\n你应该已经洗好了伤口\nWell,you shouldn\'t be reading a novel.\n嗯，你不应该读一本小说\n7）情态动词must一般疑问句否定回答要用needn\'t而不是mustn\'t。\nMust I read books every day、我必须每天读书\nNo,you needn\'t . 不，你不必\n',4),(61,'助动词','这类词本身无词义，不能单独作谓语，只能与主要动词一起构成谓语，表示不同的时态、语态、表示句子的否定和疑问，例如：\nHe does not speak English well.（他英语讲得不好。）\n句中的does是助动词，既表示一般现在时，又与not一起构成否定形式。\nA dog is running after a cat.（一条狗正在追逐一只猫。）\n句中的is 是助动词，和run的现在分词一起构成现在进行时。\nDid he have any milk and bread for his breakfast（他早餐喝牛奶、吃面包吗？）\n句中的did是助动词，既表示一般过去时，又和动词have一起构成疑问。',4),(63,'行为动词','行为动词（实义动词）是表示行为、动作或状态的词。它的词义完整，可以单独作谓语。例如：\nI live in Beijing with my mother.（我和我妈妈住在北京。）live，住\nIt has a round face.（它有一张圆脸。）has，有',4),(64,'非谓语动词','在句子中充当除谓语以外的句子成分的动词形式叫做非谓语动词。非谓语动词分为三种形式：不定式，动名词，和分词(分词包括现在分词和过去分词)。\n1）不定式\n时态\\语态　主动　被动\n一般式　to do　to be done\n完成式　to have done　to have been done\n2）动名词\n时态\\语态　主动　被动\n一般式　doing　being done\n完成式　having done　having been done\n3）分词\n时态\\语态　主动　被动\n一般式　doing　being done\n完成式　having done　having been done\n否定形式：not +不定式，　not + 动名词，　not + 现在分词',4),(65,'短语动词','动词加小品构成的起动词作用的短语叫短语动词（Phrasal Verb）。例如：\nTurn off the radio.　把收音机关上。（turn off是短语动词）\n短语动词的构成基本有下列几种：\n1） 动词+副词，如：back out；\n2） 动词+介词，如：look into；\n3） 动词+副词+介词，如：look forward to。构成短语动词的副词和介词都统称为小品词（Particle）。',4),(66,'主谓一致','主谓一致（subject-verb agreement）即谓语动词在人称和数上要和主语保持一致，主谓一致包括语法一致、意义一致和就近一致，语法一致即谓语动词在单复数形式上要和主语保持一致，意义一致就是谓语动词要和主语意义上的单复数保持一致，就近一致就是谓语动词要和靠近它的主语部分保持一致。\n语法一致：主语是单数形式，谓语也采取单数形式；主语是复数形式，谓语必须采取复数形式。\n例如：\nA grammar book helps you learn something about the rules of a language.\n(主语是单数形式，谓语也采取单数形式）\n意义一致：这一原则是指，从意义着眼来解决主谓一致问题.有时主语形式上为单数，但意义上却是复数，那么谓语依意义也用复数形式；而有时主语形式上为复数，但意义上却是单数，那么谓语依意义亦用单数形式。\n1) 当主语后面接由as well as,as much as,accompanied by,including,in addition to,more than,no less than,rather than,together with等引导的词组时，其谓语动词的形式要依主语的单复数而定.在这样的句子里，这些词所引导的词组不影响主语自身的单，复数形式，它们在句子里其实是状语.也就是说，我们完全可以将这些词组搬到句首或是放到句末去.从表面上我们也可以看出，它们与主语之间有\",\"隔开。例如：Petroleum,along with fuel gas,has recently risen in price.\n2)表示时间，金钱，距离，体积，重量，面积，数字等词语作主语时，其意义若是指总量应看作单数，谓语动词用单数；但如果其意义是指\"有多少数量\"则应该看作是复数，那么谓语动词也应该用复数。例如：Four weeks are often approximately regarded as one month.\n3)形容词前加定冠词即\"the+形容词\"作主语时，其意义若是指个人或是抽象概念应看作单数，谓语动词用单数；但如果其意义是指一类人则应该看作是复数，那么谓语动词也应该用复数。例如：The young,on the one hand,often think of the old conservative. On the other hand,the old always consider the young inexperience.\n4)当and连接两个并列主语在意义上指同一人，同一物，同一事或者同一概念时，应看作单数，谓语动词用单数.另外，当and连接两个形容词去修饰一个单数形式的主语时，其实是指两种不同的事物，主语则应该看作是复数，那么谓语动词也应该用复数。例如：War and peace is a constant theme in history.\n5)集体名词作主语时，谓语动词的数取决于主语的意义：主语表示整体时视为单数，谓语动词用单数；主语表示集体中的个体成员时视为复数，谓语动词用复数.这类集体名词常见的有：army,audience,cattle,class,club,committee,crowd,family,government,group,majority,minority,part,people,police,public,staff,team等等，其中cattle,people,police一般看成复数形式。例如：The family are all fond of football.\n\n',3),(67,'连词','连词（conjunction）是一种虚词， 它不能独立担任句子成分而只起连接词与词，短语与短语以及句与句的作用。连词主要可分为4类：并列连词.转折连词.选择连词和因果连词。连词也可以分为2类：并列连词和从属连词。\n并列结构：\n1)or意思为\"否则\"。\nI must work hard,or I\'ll fail in the exam.\n我必须努力学习，否则我的考试成绩将要下降.\n2)either…or意思为\"或者……或者……\"。注意谓语动词采用就近原则。\nEither you or I am right.\n或者是你对，或者是我对.\n转折或对比：\n1) but表示转折，while表示对比。\nSome people love cats,while others hate them.\n典型例题\nWould you like to come to dinner tonight\nI\'d like to,___ I\'m too busy.\nA. and B. so C. as D. but\n答案D。but与前面形成转折，符合语意。而表并列的and， 结果的so，原因的as都不符合句意。\n2)not…but…意思为\"不是……而是……\"\nnot 和but 后面的用词要遵循一致原则。\nThey were not the bones of an animal,but (the bones) of a human being.\n让步：\nhowever表让步，译为\"无论如何\"\nHowever we adopt healthcare reform, it isn\'t going to save major amounts of money.\n不管我们采取何种医疗改革措施，都省不下太多钱。\n误区提示：however可以表示转折，译为\"然而；不过；仍然\"但是这时为副词词性，而并非连词。\n例句：\nThis was not an easy decision. It is, however, a decision that we feel is dictated by our duty...\n这很难抉择。不过，我们觉得自己有义务作出决定。\n原因关系：\n1)for 因为\n判断改错：\n（错） For he is ill,he is absent today.\n（对） He is absent today,for he is ill.\nfor是并列连词，不能置于含两个并列分句的句子的句首，只能将其放在两个分句中间。\n2)so,therefore 因此，所以\nHe hurt his leg,so he couldn\'t play in the game.\n3)because 因为\nI cannot sleep because I am too excited.\n注意：\n这两个词的意思很相近，通常是可以互换使用的。为了安全起见，最好用because引导从句，因为同 because引导的从句相比，for引导的从句的用法要受到某些限制：\n①for引导的从句不能位于它所解释的动词之前：\nBecause it was wet he took a taxi.\n因为下雨，他叫了一辆出租车。（这里不能用for）\n②for引导的从句不能位于not，but或任何连词之后\n③for引导的从句不能用于回答问题：\n—Why did you do it？ 你为什么这么做？\n—I did it because I was angry. 因为我生气才这么做的。（这里不能用for）\n④for引导的从句不能单单用来复述已讲过的话，而必须包括新的内容：\nHe spoke in French. 他讲法语。\nShe was angry because he had spoken in French. 因为他讲法语，她生气了\n',11),(68,'从句','从句（Subordinate Clause）是复句中具有分属地位的分句， 它是一种绝大部分语言都有的语法结构。从句指复合句中不能独立成句，但具有主语部分和谓语部分，由that、who、whom、when、why、where、how、which等引导词（Connective）引导的非主句部分。\n\n\n',11),(69,'主语从句','一个句子在复合句中充当一个主语,那么这个句子就是主语从句.引导主语从句连词that,whether,who,what,whatever等，连词位于句首不能省略。\n主语从句 - 引导词\n1、由连词that引导的主语从句。 \n例如：That you will win the medal seems unlikely. \n你想获得奖牌看起来是不可能的。 \nThat you are so indifferent bothers me. \n你如此冷淡使我很烦恼。 \nThat she survived the accident is a miracle. \n她在事故中幸免于难简直是奇迹。 \n2、用连接代词或连接副词if, whether 引导的主语从句。 \n例如： Which of them escaped from the prison is still a mystery. \n他们哪一个是从监狱里逃跑的，仍然是个谜。 \nWhen they will come hasn’t been made pubic. \n他们什么时候来还不知道。 \nWhether she is coming or not doesn’t matter too much. \n她来不来都无关紧要。 \n3、用关系代词引导的主语从句。 \n例如：What you need is more practice. \n你所需要的是更多的训练。 \nWhat I want to know is this. 我想知道的就是这事。 \nWhatever we do is to serve the people. \n我们无论做什么都是为人民服务。 \n4、主语从句可以直接放在主语位置上，也可以用it作形式主语，而将从句放在句末（尤其是当谓语较短时）。 \n例如：That light travels in straight lines is known to all. \n光沿直线传播，这是众所周知的事。 \n=It is known to all that light travels in straight lines. \n众所周知光沿直线传播。 \nWhen the plane is to take off has not been announced . \n飞机何时起飞还没有宣布。 \n= It has not been announced when the plane is to take off. \n还没有宣布飞机何时起飞。 \n当what引导的主语从句表示“…的东西”时，一般不用it作形式主语。 \n错:It is a book what he wants. \n对:What he wants is a book. 他想要的是本书。 \n如果带主语从句的句子是疑问式，则必须用it作形式主语的结构。 \n例如：Has it been settled who will be sent to carry out the task ? \n谁将被派去执行这项任务决定了吗 ？',11),(70,'疑问词','疑问词分为疑问代词“who, what, which, whose”和疑问副词“when, where, how, why ”。',10),(71,'状语从句','状语从句（Adverbial Clause）状语从句指句子用作状语时， 起副词作用的句子。 它可以修饰谓语、 非谓语动词、 定语、 状语或整个句子。 根据其作用可分为时间、 地点、 原因、 条件、 目的、 结果、 让步、 方式和比较等从句。 状语从句一般由连词(从属连词)引导， 也可以由词组引起。从句位于句首或句中时通常用逗号与主句隔开，位于句尾时可以不用逗号隔开。\n状语从句 - 时态特点\n一般情况下，时间和条件状语从句的谓语动词一般用“一般现在时”表示“一般将来时”，用“现在完成时”表示“将来完成时”。例如：\nI will call you as soon as I arrive in Beijing. 我到北京就将给你打电话。（这是由as soon as引导的时间状语从句，从句中的谓语动词arrive是一般现在时，表示一般将来时，绝不可用will arrive）\nAs soon as I have finished this work, I will have gone home. 我一完成此工作，就回家。（从句中的谓语动词用现在完成时have finished，表示将来完成时,绝不可用will have finished）\nIf he comes back, please let me know.如果他回来了，请通知我。（从句中的谓语动词用comes back,表示一般将来时，绝不可用will come back）',11),(72,'表语从句','表语从句（Predicative Clause）就是用一个句子作为表语。说明主语是什么或者怎么样，由名词、形容词或相当于名词或形容词的词或短语充当表语。\n表语从句定义：在一个复合句中，从句作的是主句的表语成分。\n\nA\n\nThe problem is puzzling.\n\n这个问题令人困惑。\n\n主语+连系动词+形容词作表语\n\nThe problem is when we can get a pay rise.\n\n问题是什么时候我们可以得到加薪。\n\n主语+连系动词+句子作表语（表语从句）\n\nB\n\n连接表语从句的连接词有：that, what, who, when, where, which, why, whether, how, whoever，whichever ，whatever等。还有如because, as if, as though等。\n\nHe has become a teacher.\n\n他已经成为一名教师。\n\nHe has become what he wanted to be ten years ago.\n\n他已经成为了他10 年前想成为的。\n\nHis suggestion is good.\n\n他的建议是好的。\n\nHis suggestion is that we should stay calm.\n\n他的建议是，我们应该保持冷静。\n\nThe question is confusing.\n\n这个问题令人困惑。\n\nThe question is when he can arrive at the hotel.\n\n问题是，他什么时候可以到达酒店。',11),(73,'宾语从句','宾语从句是名词性从句的一种。在主从复合句中充当宾语，位于及物动词、介词或复合谓语之后的从句称为宾语从句。宾语从句分为三类：动词的宾语从句，介词的宾语从句和形容词的宾语从句。\n宾语从句的连接词：that\n结构：主语+谓语+宾语（陈述语序）\n注意：\n引导词为that ；\n语序为v.+主语+谓语+由if、whether引导宾语从句；\n主句为现在时 从句为任意时态。\n从属连词\n连接宾语从句的从属连词主要有that,if,whether，和疑问词（what， how， where， when ...)。\nthat引导表示陈述句的宾语从句，\nif和whether，whether...or not引导表示“是否”的一般疑问句的宾语从句。\n关联代词\n连接代词主要有who,whom,whose,what,whoever,whomever,whosever,whatever,whichever等。\n连接代词一般指疑问，但what,whatever除了指疑问外，也可以指陈述。\n关联副词\n连接副词主要有when,where,why,how,whenever,wherever,however等。\n例句：\nHe didn’t tell me when we should meet again.\n他没有告诉我什么时候我们能再见面。\n注：宾语从句通常跟在名词或代词后面。',11),(74,'同位语从句','同位语从句指的是在复合句中充当同位语的从句，属于名词性从句的范畴，同位语从句用来对其前面的抽象名词进行解释说明，被解释说明的词和同位语在逻辑上是主表关系\n一个名词（或其它形式）对另一个名词或代词进行修饰，限定或说明，这个名词（或其它形式）就是同位语。同位语与被它限定的词的格式要一致，并常常紧挨在一起。同位语从句即重复说明同一个称谓或事件的从句。\n名词作同位语\nMr Wang,my child’s teacher,will be visiting us on Tuesday.王先生，我孩子的老师，星期二要来看我们。\n（在这里\'my child\'s teacher\'做同位语修饰\'Mr Wang\')\n短语作同位语\nI,the oldest girl in the family,always had to care for the other children.我，作为家里最大的女孩，总是要照料家中的其他孩子。\n直接引语作同位语\nBut now the question comes to their minds，“Did she die young because she was a clone?”但是现在他们不得不思考这样的问题：“多莉早死是因为它是一只克隆羊吗？”\n句子作同位语\nThe girls were surprised at the fact that ocean ships can sail up the Great lakes.巨大的海轮可以开到五大湖，让表姐妹俩感到吃惊。\n固定用法\n同位语部分是个句子，就是同位语从句，这种用法比较\"固定\"\n一、在复合句中用作同位语的从句叫同位语从句。它一般跟在某些名词后面，用以说明该名词表示的具体内容。\nI heard the news that our team had won．我听到了我们队获胜的消息。\n二、可以跟同位语从句的名词通常有news，idea，fact，promise，question，doubt，thought，hope，message，suggestion，words（消息），possibility,decision等（一般的“抽象”名词都可用）。\nI’ve come from Mr wang with a message that he won’t be able to see you this afternoon． 我从王先生那里来，他让我告诉你他今天下午不能来看你了。\n三、英语中引导同位语从句的词通常有连词that，whether，连接代词what，who。连接副词how,when,where等。（注：if不能引导同位语从句。）\nHe must answer the question whether he agrees with it or not. 他必须回答他是否同意这样一个问题。\n四、有时同位语从句可以不紧跟在说明的名词后面，而被别的词隔开。\nThe thought came to him that maybe the enemy had fled the city． 他突然想起敌人可能已经逃出城了。',11),(75,'定语从句','定语从句，一个简单句跟在一名词或代词后（先行词）进行修饰限定，就叫做定语从句。在主句中充当定语成分。\n被修饰的词叫先行词。定语从句不同于单词作定语的情况，它通常只能放在被修饰的词（即先行词）之后。定语 从句由关系词（关系代词、关系副词）引导，关系代词、关系副词位于定语从句句首。\n　　\n　　关系代词引导的定语从句\n　　关系代词所代替的先行词是人或物的名词或代词，并在句中充当主语、宾语、定语等成分。关系代词在定语 从句中作主语时，从句谓语动词的人称和数要和先行词保持一致。\n1）who, whom, that\n　　这些词代替的先行词是人的名词或代词，在从句中所起作用如下：\n　　Is he the man who/that wants to see you?\n　　他就是想见你的人吗？（who/that在从句中作主语）　He is the man whom/ that I saw yesterday.\n　　他就是我昨天见的那个人。（whom/that在从句中作宾语）\n2) Whose 用来指人或物，(只用作定语, 若指物，它还可以同of which互换）, 例如：\n　　They rushed over to help the man whose car had broken down. 那人车坏了，大家都跑过去帮忙。\n　　Please pass me the book whose (of which) cover is green. 请递给我那本绿皮的书。\n3）which, that\n　　它们所代替的先行词是事物的名词或代词，在从句中可作主语、宾语等，例如：\n　　A prosperity which / that had never been seen before appears in the countryside. 农村出现了前所未 有的繁荣。（which / that在句中作主语）\n　　The package which / that you are carrying is about to come unwrapped. 你拿的包快散了。(which / that 在句中作宾语）\n　　关系副词引导的定语从句\n　　关系副词可代替的先行词是时间、地点或理由的名词，在从句中作状语。\n1）when, where, why\n　　关系副词when, where, why的含义相当于\"介词+ which\"结构，因此常常和\"介词+ which\"结构交替使用，例 如：\n　　There are occasions when (on which) one must yield. 任何人都有不得不屈服的时候。\n　　Beijing is the place where (in which) I was born. 北京是我的出生地。\n　　Is this the reason why (for which) he refused our offer? 这就是他拒绝我们帮助他的理由吗？\n2）that代替关系副词\n　　that可以用于表示时间、地点、方式、理由的名词后取代when, where, why和\"介词+ which\"引导的定语从 句，在口语中that常被省略，例如：\n　　His father died the year (that / when / in which) he was born. 他父亲在他出生那年逝世了。\n　　He is unlikely to find the place (that / where / in which) he lived forty years ago. 他不大可能找到他四十 年前居住过的地方。\n判断关系代词与关系副词\n　　方法一： 用关系代词，还是关系副词完全取决于从句中的谓语动词。及物动词后面无宾语，就必须要 求用关系代词。例如：\n　　（错） This is the mountain village where I visited last year.\n　　（错） I will never forget the days when I spent in the countryside.\n　　（对） This is the mountain village (which) I visited last year.\n　　（对） I\'ll never forget the days (which) I spent in the countryside.\n　　习惯上总把表地点或时间的名词与关系副词 where, when联系在一起。此两题错在关系词的误用上。\n　　方法二： 准确判断先行词在定语从句中的成分(主、谓、宾、定、状)，也能正确选择出关系代词/关系 副词.先行词在从句中作主、定、宾语时，应选择关系代词；先行词在从句中作状语时，应选 择关系副词。\n例如：（对）Is this the museum which you visited a few days ago?\n（对）Is this the museum where the exhibition was held?\n',11),(76,'交际用语','交际用语是用于商务交往和生活交往的标语，交际用语在功能性上分商务交际用语和日常生活用语。',13),(77,'物主形容词','包括人称代词的所有格（形容词性物主代词）和名词的所有格。如：\nMy room is just above. 我的房间就在楼上。\nAcquaint him with your plans. 把你的计划告诉他。',5),(78,'指示形容词','指示代词this，that，these，those之后接名词或one/ones，成为指示形容词。如：\nThis book of Joe\'s is very amusing. 乔的这本书非常有趣。\nI dislike man of that type. 我不喜欢那一类型的人。',5),(79,'疑问形容词','疑问代词which，whose，what之后接名词或代词，成为疑问形容词。如：\nWhose bike is it? 这是谁的自行车？\nWhat books have you read on this subject? 你读过哪些关于这方面的书？',5),(80,'关系形容词','关系代词which，whose，what之后接名词，成为关系形容词。如：\nThe men whose names were called left the room. 哪些被叫到名字的人离开了房间。\nDo you give her what money you had? 你把你所有的钱都给了她吗？',5),(81,'副词形容词','有少数副词由于没有相应的形容词，也可以充当形容词。如：\nThe ball here is mine. 这儿的这个球是我的。\nHe caught the up train. 他赶上了上行的火车。',5),(82,'动词形容词','由动词转化成的形容词，即动名词、过去分词。如：\nIn spring we uncover the swimming pool. 春天我们移去游泳池的覆盖物。\nThere is running water in the kitchen and the bathroom. 厨房和卫生间都有自来水。',5);
